import React from "react";
import Sliding from "./Sliding/Sliding";
import Menu from "./Menu/Menu";
// import Cart from "./Cart/Cart";
import Footer from "./Footer/Footer";

function Dashboard() {
  return (
    <div>
      <Sliding />
      <Menu />
      <Footer />
    </div>
  );
}

export default Dashboard;
